    await page.fill('#password', 'your_password');

    // Click the login button
    await page.click('button.login-btn');

    // Wait for navigation after login
    await page.waitForLoadState('networkidle');

    // Take screenshot after login
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_login.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_login.png'));

    // Extract meaningful data (e.g., user name or profile info)
    const userName = await page.textContent('selector_for_user_name'); // Replace with actual selector
    const postEngagement = await page.evaluate(() => {
      // Example of extracting post engagement data
      return document.querySelectorAll('selector_for_post_engagement').length; // Replace with actual selector
    });

    return {
      success: true,
      action: "Analyzed own post engagement",
      extractedData: {
        userName,
        postEngagement
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

